import{_ as e,o as t,c as i,a as l}from"./app-568110d5.js";const a={},n=l('<h1 id="high-level-process" tabindex="-1"><a class="header-anchor" href="#high-level-process" aria-hidden="true">#</a> High Level Process</h1><h2 id="engage" tabindex="-1"><a class="header-anchor" href="#engage" aria-hidden="true">#</a> Engage</h2><p>Initial engagement to the client: Such as the following:</p><ul><li>meetings with the client</li></ul><h2 id="identify" tabindex="-1"><a class="header-anchor" href="#identify" aria-hidden="true">#</a> Identify</h2><p>During the engagement, Outsoar should identify the following:</p><ul><li>What is the client&#39;s problem?</li><li>What is the client&#39;s goal?</li><li>What is the client&#39;s budget?</li><li>What is the client&#39;s timeline?</li><li>What is the client&#39;s current solution?</li><li>What is the client&#39;s current process?</li><li>What is the client&#39;s current technology?</li><li>What is the client&#39;s current team?</li><li>What is the client&#39;s current workflow?</li><li>What is the client&#39;s current pain points?</li><li>What is the client&#39;s current bottlenecks?</li></ul><h2 id="create-non-valuables" tabindex="-1"><a class="header-anchor" href="#create-non-valuables" aria-hidden="true">#</a> Create Non-Valuables</h2><ul><li>Doenst mean it has no value, But these are the actions that has no direct impact to the client&#39;s problem or goal but it is necessary to create these non-valuables to provide value to the client. This might be internal process, documentation, etc.</li></ul><p>Example:</p><ul><li>How we manage tickets</li><li>Documentation</li><li>Internal process etc.</li></ul><p>This might be audited by the client and provide transparency to the client. These items should be proven and tested: Derived from the experience of the team/agency.</p><h2 id="provide-value" tabindex="-1"><a class="header-anchor" href="#provide-value" aria-hidden="true">#</a> Provide Value</h2><p>Provide value to the client by solving the problem or achieving the goal.</p><p>At these stage, we should be able to provide the following:</p><ul><li>solution to the client&#39;s problem.</li><li>provide productivity to the client process.</li><li>provide efficiency to the client&#39;s workflow.</li></ul>',16),h=[n];function s(o,r){return t(),i("div",null,h)}const d=e(a,[["render",s],["__file","high-level-process.html.vue"]]);export{d as default};
